package misc

import (
	"github.com/ethereum/go-ethereum/common"

	"github.com/flare-foundation/coreth/core/state"
	"github.com/flare-foundation/coreth/params"
)

var flareDaemonUpgrade = CoreContractUpdate{
	Address: params.DaemonAddress,
	Old:     common.FromHex(""),
	New:     common.FromHex(""),
}

func FlareDaemonUpgraded(statedb *state.StateDB) bool {
	return updateApplied(statedb, flareDaemonUpgrade)
}

func UpgradeFlareDaemon(statedb *state.StateDB) {
	applyUpdate(statedb, flareDaemonUpgrade)
}
